import React from 'react';
import { Link } from 'react-router-dom';

const NavBar = () => {
    return (  
   <div>
    <nav className='header__nav'>
        <ul className='header__list'>
            <li className='header__item'><Link to='/home'/>Home</li>
            <li className='header__item'><Link to='/about'/>About</li>
            <li className='header__item'><Link to='/blog'/>Blog</li>
            <li className='header__item'><Link to='/saved'/>Saved</li>
            

        </ul>
    </nav>
   </div>
        );
}
 
export default NavBar;
